import React from "react";
import LazyHero from "react-lazy-hero";
import CookieConsent from "react-cookie-consent";
import { Helmet } from "react-helmet";
import { Container, Row, Col } from "reactstrap";
import {
  Animation,
  MDBBtn,
  MDBJumbotron,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBModal,
  MDBModalBody,
  MDBModalHeader,
  MDBModalFooter,
  MDBInput,
  MDBIcon,
  MDBCarousel,
  MDBCarouselCaption,
  MDBCarouselInner,
  MDBCarouselItem,
  MDBView,
  MDBMask,
  MDBTable,
  MDBTableBody
} from "mdbreact";
import { connect } from "react-redux";

import "bootstrap/dist/css/bootstrap.min.css";
import "./Home.css";
import Marcel from "./Pics/marcel.png";
import Hero from "./Pics/hero.jpg";
import Goal from "./Pics/goal.jpg";
import Vision from "./Pics/vision.jpg";
import Task from "./Pics/task.jpg";
import Phone from "./Pics/phone.jpg";
import Logo from "./Pics/brand.png";
import Oli from "./Pics/Oli.jpeg";
import Thomas from "./Pics/Thomas.jpeg";
import Courier from "./Pics/courier.jpg";
import Concept from "./Pics/concept.png";
import ConceptD from "./Pics/conceptd.png";
import ConceptP from "./Pics/conceptp.png";
import Back from "./Pics/back.png";

//Symbols
import Approved from "./Pics/symbols/approved.png";
import Vorteil1 from "./Pics/symbols/Vorteil1.png";
import Vorteil2 from "./Pics/symbols/Vorteil2.png";
import Vorteil3 from "./Pics/symbols/Vorteil3.png";
import Vorteil4 from "./Pics/symbols/Vorteil4.png";
import Vorteil5 from "./Pics/symbols/Vorteil5.png";
import S1 from "./Pics/symbols/1.png";
import S2 from "./Pics/symbols/2.png";
import S3 from "./Pics/symbols/3.png";
import S4 from "./Pics/symbols/4.png";
import Enkdunden from "./Pics/symbols/Enkdunden.png";
import Pakethubs from "./Pics/symbols/Pakethubs.png";
import Play from "./Pics/symbols/play.png";
import App from "./Pics/symbols/app.png";

class Paketdienstleister extends React.Component {
  // Scroll to top when changing sites

  componentWillUnmount() {
    window.scrollTo(0, 0);
  }

  componentDidMount() {
    this.props.dispatch({ type: "NAVHOME" });
  }

  render() {
    return (
      <div className="Home Background">
        {/* Hero-Image newes Version*/}
        <LazyHero
          color="#ffffff"
          minHeight="50vh"
          style={{ background: "#ffffff" }}
        >
          <MDBContainer className="Jumbotron3" fluid no-gutters>
            <MDBRow no-gutters>
              <MDBCol size="12">
                <h1
                  style={{
                    "padding-bottom": "1%",
                    "padding-top": "1%",
                    fontSize: "2em"
                  }}
                >
                  <b>
                    {" "}
                    Massiv steigendes Sendungsvolumen und immer weniger
                    Paketzusteller
                  </b>
                </h1>
              </MDBCol>
            </MDBRow>
            <MDBRow no-gutters>
              <MDBCol size="12">
                <h1
                  style={{
                    "padding-bottom": "1%",
                    "padding-top": "1%",
                    "padding-left": "4%",
                    "padding-right": "4%",
                    fontSize: "3em"
                  }}
                >
                  <br />
                  PAXET - Die Lösung mit viele Vorteilen
                </h1>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
        </LazyHero>

        <MDBJumbotron className="Jumbotron3" fluid no-gutters>
          <MDBContainer className="Jumbotron" fluid no-gutters>
            <MDBRow
              className="Sup1"
              style={{
                "padding-top": "2%",
                display: "flex"
              }}
            >
              <MDBCol
                size="12"
                style={{
                  "padding-top": "7.5%",
                  "padding-left": "2.5%",
                  "padding-right": "2.5%"
                }}
              >
                <h1>
                  Das Sagen unsere Endkunden, die über PAXET ihre Pakete
                  erhalten haben:
                </h1>
              </MDBCol>
            </MDBRow>
            <div
              style={{
                "padding-bottom": "0px",
                fontSize: "1em"
              }}
            >
              <MDBRow
                style={{
                  "padding-left": "10%",
                  "padding-top": "2.5%",
                  "padding-right": "10%",
                  height: "5%"
                }}
              >
                <MDBCol
                  size="lg"
                  md="12"
                  sm="12"
                  className="align-self-top"
                  style={{ fontSize: "0.5em", "padding-top": "2.5%" }}
                >
                  <MDBTable borderless responsive>
                    <MDBTableBody>
                      <div>
                        <tr>
                          <td style={{ height: "27ch" }}>
                            <h2
                              style={{
                                "padding-bottom": "5%",
                                "padding-top": "2%"
                              }}
                            >
                              Entlastung der Paketboten
                            </h2>
                            <h3
                              style={{
                                "padding-bottom": "5%",
                                "padding-top": "2%",
                                fontSize: "1.5em"
                              }}
                            >
                              Franziska B. (über Instagram)
                            </h3>
                          </td>
                        </tr>
                      </div>
                    </MDBTableBody>
                  </MDBTable>
                </MDBCol>
                <MDBCol
                  size="lg"
                  md="12"
                  sm="12"
                  className="align-self-top"
                  style={{ fontSize: "0.5em", "padding-top": "2.5%" }}
                >
                  <MDBTable borderless responsive>
                    <MDBTableBody>
                      <div>
                        <tr>
                          <td style={{ height: "27ch" }}>
                            <h2
                              style={{
                                "padding-bottom": "5%",
                                "padding-top": "2%"
                              }}
                            >
                              „Gestern ein Paket von einer freundlichen Person
                              aus meinem Studentenwohnheim erhalten. Was für ein
                              Zufall, sie war auch aus Bolivien und wir haben
                              uns direkt angefreundet“
                            </h2>
                            <h3
                              style={{
                                "padding-bottom": "5%",
                                "padding-top": "2%",
                                fontSize: "1.5em"
                              }}
                            >
                              Eliana S. (über Instagram)
                            </h3>
                          </td>
                        </tr>
                      </div>
                    </MDBTableBody>
                  </MDBTable>
                </MDBCol>
              </MDBRow>
            </div>
          </MDBContainer>

          <MDBContainer
            className="Jumbotron"
            fluid
            no-gutters
            style={{
              "padding-bottom": "2.5%",
              "padding-top": "2.5%"
            }}
          >
            <MDBRow no-gutters>
              <MDBCol size="12">
                <h2
                  style={{
                    "padding-bottom": "1%",
                    "padding-top": "1%",
                    fontSize: "2em"
                  }}
                >
                  <b>Noch kein Mitglied der PAXET Community?</b>
                </h2>
              </MDBCol>
            </MDBRow>

            <MDBRow no-gutters>
              <MDBCol size="12">
                <MDBBtn
                  style={{ "border-radius": "24px" }}
                  rounded
                  color="danger"
                  href="https://docs.google.com/forms/d/e/1FAIpQLSe8FCSxk7PVUXsMuc3o3YaaE5IV6zNl3g9AmnfN02DCeOdnnQ/viewform?vc=0&c=0&w=1"
                >
                  Jetzt Teil werden!
                </MDBBtn>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
        </MDBJumbotron>

        {/*	Hier wird der Cookie und deren Parameter bestimmt	*/}
        <CookieConsent
          location="bottom"
          buttonText=<a href="">Akzeptieren.</a>
          cookieName="CookieConsent"
          acceptOnScroll={true}
          acceptOnScrollPercentage={10}
          style={{ background: "#2B373B" }}
          buttonStyle={{ color: "#4e503b", fontSize: "13px" }}
          expires={150}
        >
          Diese Webseite benutzt Cookies, um die Benutzererfahrung zu
          verbessern. Indem Sie diese Website nutzen, erklären Sie sich mit
          dieser Verwendung einverstanden.
        </CookieConsent>
      </div>
    );
  }
}

const mapStateToProps = function(state) {
  return {
    home: state.home
  };
};
export default connect()(Paketdienstleister);
